import React, { useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
	Chart as ChartJS,
	CategoryScale,
	LinearScale,
	PointElement,
	LineElement,
	Title,
	Tooltip,
	Legend,
} from 'chart.js';
import './CurrentPrice.css';

ChartJS.register(
	CategoryScale,
	LinearScale,
	PointElement,
	LineElement,
	Title,
	Tooltip,
	Legend
);

const TodaysPrices = ({ todaysPrices }) => {
	useEffect(() => {
		const labels = Array.from({ length: 24 }, (e, i) => i);
		console.log(labels);

		const prices = Array.from(todaysPrices, (days) => {
			return days['total'];
		});
		console.log(prices);

		const data = {
			labels,
			datasets: [
				{
					label: 'TodaysPrices',
					data: prices,
					borderColor: 'rgb(255, 99, 132)',
					backgroundColor: 'rgba(255, 99, 132, 0.5)',
				},
			],
		};
	}, []);

	return (
		<div className='todaysPrices'>
			<h1>Todays Prices</h1>
			{data && (
				<Line
					data={data}
					height={400}
					width={800}
					options={{ maintainAspectRatio: true }}
				/>
			)}
		</div>
	);
};

export default TodaysPrices;
